40\u0435\u043a\u043b\u044e\u0447\u0438\u0442\u044c\u0441\u044f \u043d\u0430 \u043d\u0435\u0433\u043e \u043c\u043e\u0436\u043d\u043e \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f.\n\n\u0420\u0435\u0436\u0438\u043c \"O/D Off\" (\u0438\u043d\u043e\u0433\u0434\u0430 \u043e\u0431\u043e\u0437\u043d\u0430\u0447\u0430\u0435\u0442\u0441\u044f \u0446\u0438\u0444\u0440\u043e\u0439 \"3\") \u0431\u043b\u043e\u043a\u0438\u0440\u0443\u0435\u0442 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u044e\u044e \u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0443, \u0432\u043a\u043b\u044e\u0447\u0430\u0442\u044c \u0435\u0433\u043e \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0443\u0435\u0442\u0441\u044f \u0442\u043e\u043b\u044c\u043a\u043e \u0435\u0441\u043b\u0438 \u043c\u0430\u0448\u0438\u043d\u0430 \u0435\u0434\u0435\u0442 \u0441\u043e \u0441\u043a\u043e\u0440\u043e\u0441\u0442\u044c\u044e \u043d\u0435 \u0432\u044b\u0448\u0435 60 \u043a\u043c/\u0447\u0430\u0441.\n\n\"PWR\" \u0441\u043f\u043e\u0441\u043e\u0431\u0435\u043d \u0443\u0432\u0435\u043b\u0438\u0447\u0438\u0442\u044c \u0434\u0438\u043d\u0430\u043c\u0438\u043a\u0443 \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u044f, \u043f\u0440\u0430\u0432\u0434\u0430, \u0440\u0430\u0441\u0445\u043e\u0434 \u0442\u043e\u043f\u043b\u0438\u0432\u0430 \u043f\u0440\u0438 \u044d\u0442\u043e\u043c \u0442\u043e\u0436\u0435 \u0432\u043e\u0437\u0440\u0430\u0441\u0442\u0435\u0442. \u0410 \"Manu\" \u0431\u0443\u0434\u0435\u0442 \u043f\u043e\u043b\u0435\u0437\u0435\u043d \u043d\u0430 \u043e\u0431\u043b\u0435\u0434\u0435\u043d\u0435\u0432\u0448\u0435\u0439 \u0434\u043e\u0440\u043e\u0433\u0435.\n\n\u2014\u2014\u2014\u2014\u2014\u2014\n\n\u0411\u0456\u0440 \u049b\u0430\u0440\u0430\u0493\u0430\u043d\u0434\u0430 \u0430\u0432\u0442\u043e\u043c\u0430\u0442\u0442\u044b \u0431\u0435\u0440\u0456\u043b\u0456\u0441 \u049b\u043e\u0440\u0430\u0431\u044b (\u0410\u0411\u049a) \u0431\u0430\u0440 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c\u0434\u0435\u0440\u0434\u0456 \u0436\u04af\u0440\u0433\u0456\u0437\u0443 \u043f\u0440\u043e\u0446\u0435\u0441\u0456 \u0434\u04d9\u0441\u0442\u04af\u0440\u043b\u0456 \u043c\u0435\u0445\u0430\u043d\u0438\u043a\u0430\u0493\u0430 \u049b\u0430\u0440\u0430\u0493\u0430\u043d\u0434\u0430 \u04d9\u043b\u0434\u0435\u049b\u0430\u0439\u0434\u0430 \u0436\u0435\u04a3\u0456\u043b \u043a\u04e9\u0440\u0456\u043d\u0435\u0434\u0456, \u043a\u04e9\u0431\u0456\u0441\u0456 \u041c\u041a\u049a\u041f \u043c\u0456\u043d\u0456\u043f \u0436\u04af\u0440\u0443\u0434\u0456 \u04b1\u043c\u044b\u0442\u044b\u043f \u043a\u0435\u0442\u043a\u0435\u043d. \u0410\u043b\u0430\u0439\u0434\u0430, \u0436\u04af\u0440\u0433\u0456\u0437\u0443\u0448\u0456\u043b\u0435\u0440 \u043a\u04e9\u0431\u0456\u043d\u0435\u0441\u0435 \u0410\u0411\u049a-\u043d\u044b\u04a3 \u0431\u0435\u043b\u0433\u0456\u043b\u0456 \u0431\u0456\u0440 \u0440\u0435\u0436\u0438\u043c\u0434\u0435\u0440\u0456\u043d \u0434\u04b1\u0440\u044b\u0441 \u043f\u0430\u0439\u0434\u0430\u043b\u0430\u043d\u0431\u0430\u0439\u0434\u044b, \u0434\u0435\u0439\u0434\u0456 \u0441\u0430\u0440\u0430\u043f\u0448\u044b\u043b\u0430\u0440. \n\"L\" \u0440\u0435\u0436\u0438\u043c\u0456 (\u0431\u0456\u0440\u0456\u043d\u0448\u0456 \u0431\u0435\u0440\u0456\u043b\u0456\u0441) \u0441\u044b\u0440\u0493\u0443 \u043a\u0435\u0437\u0456\u043d\u0434\u0435 \u0431\u0456\u0440\u0456\u043d\u0448\u0456 \u0431\u0435\u0440\u0456\u043b\u0456\u0441\u0442\u0435\u043d \u0430\u0443\u044b\u0441\u0443\u0434\u044b \u0431\u04b1\u0493\u0430\u0442\u0442\u0430\u0443 \u04af\u0448\u0456\u043d, \u0441\u043e\u043d\u0434\u0430\u0439-\u0430\u049b \u0436\u043e\u0493\u0430\u0440\u044b \u0436\u044b\u043b\u0434\u0430\u043c\u0434\u044b\u049b\u0442\u0430 \u0436\u04af\u0440\u0443 \u04af\u0448\u0456\u043d \u049b\u043e\u043b\u0434\u0430\u043d\u044b\u043b\u0430\u0434\u044b. \"2\" \u0440\u0435\u0436\u0438\u043c\u0456 \u0442\u04e9\u043c\u0435\u043d \u0442\u04af\u0441\u0443\u0433\u0435 \u043d\u0435\u043
